import { Row, Col, Container } from "reactstrap";

import FilterProvider from "./filterContext";
import ExlReader from "./container/ExlReader";
import Filter from "./container/Filter";

const App = () => {
	return (
		<>
			<Container fluid>
				<Row>
					<Col md={2}>
						<Filter />
					</Col>
					<Col md={10}>
						<ExlReader />
					</Col>
				</Row>
			</Container>
		</>
	);
};

export default App;
